import styled from 'styled-components';
//
export const Title = styled.div`

    display: flex;
    align-items: center;
    justify-content:space-around;
    padding:15px;
    color: white;
    font-size:20px;
    background-color:lightpink;
`
export const LogoImage = styled.img`
 
 width: 6vw;
 height:6vh;


`
export const AnchorTag = styled.a`
 
cursor:pointer;

&:hover {
    color:black;
  }
`
